const numbers = [9, 8, 7, 6, 5, 4, 3, 2, 1, 0];

const App = () => {
  return (
    <div className="App container mt-4">
      <h3>Welcome to React Calculator</h3>
      {numbers.map(numberFromMap => (
          <NumberButton number={numberFromMap} key={studentFromMap.name} />
        ))}
    </div>
  );
};

export default App;
